.profile-completion-popup {
  position: relative;
  display: flex;
  flex-direction: column;
  align-items: center;
  margin-top: 33px;
  margin-bottom: 19px;
  &__close {
    position: absolute;
    right: 30px;
    top: -90px;
  }
  &__cover {
    &--idcard {
      padding: 0 220px;
    }
    &--payment {
      padding: 0 160px;
    }
    &--payment-password {
      padding: 0 160px;
    }
    > img {
      width: 100%;
    }
  }
  &__text {
    font-size: 24px;
    color: #787f8c;
    margin-top: 24px;
    white-space: pre-wrap;
    text-align: center;
  }
}

